import React from 'react';
import "./Card.css";
<div className="card">
</div>
interface Props {
  companyName: string;
  ticker: string;
  price: number;
}
const Card: React.FC<Props>= ({companyName,ticker,price}: Props): JSX.Element => {
  return <div className="card">
    <img src="https://play-lh.googleusercontent.com/LHjOai6kf1IsstKNWO9jbMxD-ix_FVYaJSLodKCqYQdoFVzQBuV9z5txxzcTagQcyX8" alt="image" />
    <div className="details">
        <h2>{ticker}</h2>
        <p>{price}</p>
    </div>
    <p className="info">Lorem ipsum dolor sit amet consectetur adipisicing elit. Vero earum, asperiores rerum laboriosam porro suscipit, doloremque recusandae maxime tempora nobis, minima consectetur esse corporis! Aliquid in laboriosam quae magni doloribus.</p>
  </div>
}
export default Card
